    "instruction": "DISplay?",
    "description": "返回当前显示设置",
    "original_text": "DISplay? Returns current display settings\nDISplay:CLOCk Specifies the display of the date/time stamp\nDISplay:COLor:MODe Sets or queries the color mode for the graticule and waveform display.\nDISplay:CONFIGure:READOut Configures or returns readout backgrounds.\nDISplay:DIGital:ACTIVity Sets or returns the state of the digital channel monitor display.\nDISplay:DIGital:HEIght This command specifies the number of available digital waveform position slots.\nDISplay:GRAticule This command specifies the type of graticule that is displayed\nDISplay:INTENSITy? Returns all display intensity settings\nDISplay:INTENSITy:BACKLight This command specifies the backlight intensity for the display\nDISplay:INTENSITy:BACKLight:\nAUTODim:ENAble\nSets or returns the state of the display auto-dim feature. The default is enabled.\nDISplay:INTENSITy:BACKLight:\nAUTODim:TIMe\nSets or returns the amount of time, in minutes, to wait for no UI activity before automatically\ndimming the display.\nDISplay:INTENSITy:GRAticule This command specifies the graticule intensity for the display\nDISplay:INTENSITy:WAVEform This command specifies the intensity of the waveforms\nDISplay:PERSistence This command specifies the display persistence for analog waveforms. This affects the\ndisplay only.\nDISplay:STYle:DOTsonly This command turns on or off the dots-only mode for the waveforms displayed in the time\ndomain.\nDISplay:TRIGFrequency This command switches the trigger frequency readout on or off.\nDISplay:XY This command turns on o"
