    "original_text": "DISplay:CLOCk\nThis command specifies whether the oscilloscope displays the date and time. The\nquery form of this command returns an ON (1) or an OFF (0).\nGroup Display\nSyntax DISplay:CLOCk {ON|OFF|<NR1>}"
