    "description": "开启或关闭触发频率读数",
    "original_text": "DISplay:TRIGFrequency\nThis command switches the trigger frequency readout on or off.\nGroup Display\n3 Series MDO Oscilloscopes Programmer Manual 2-269\nCommands Listed in Alphabetical Order\nSyntax DISplay:TRIGFrequency {OFF|ON|0|1}"
