    "description": "设置或返回TRIGgered XY显示模式下XY和YT波形同时显示的状态，当XY和YT波形都显示时，YT波形显示在上部光栅中，XY波形显示在下部光栅中",
    "original_text": "DISplay:XY:WITHYT\nSets or returns the state of simultaneous display of the XY and YT waveforms\nwhen in TRIGgered XY display mode. (To set the mode to TRIGgered XY\ndisplay, first use the command :DISplay:XY TRIGgered.)\nWhen both the XY and YT waveforms are displayed, the YT waveform is\ndisplayed in the upper graticule, and the XY waveform is displayed in the lower\ngraticule.\nFor this platform, the default state is 0 (XY display only).\n2-270 3 Series MDO Oscilloscopes Programmer Manual\nCommands Listed in Alphabetical Order\nNOTE. this command does not take effect if the :DVM:DISPLAYSTYle is set to\nFULl, but will take effect once the :DVM:DISPLAYSTYle is set to MINimum or if\nthe DVM is turned off.\nGroup Display\nSyntax DISplay:XY:WITHYT {0|1|OFF|ON}"
