    "original_text": "EVENT? (Query Only)\nReturns an event code from the Event Queue that provides information about the\nresults of the last *ESR? read. EVENT? also removes the returned value from\nthe Event Queue.\nGroup Status and Error\nSyntax EVENT?\nRelated Commands ALLEv?, *CLS, DESE, *ESE, *ESR?, EVMsg?, *SRE, *STB?\nExamples EVENT? might return:EVENT 110, showing that there was an error in a command\nheader. (See page 3-13, Messages.)"
