    "original_text": "FILESystem:MKDir\nArguments None\nReturns FILESystem:DIR? returns a list of files and directories in the current working\ndirectory.\nExamples FILESYSTEM:DIR? might return\n:FILESYSTEM:DIR\n\"tek00000.png\",\"my_CAN_setup.set\",\"savedWfm1.isf\",\"myImages\""
