    "original_text": "HORizontal:DIGital:RECOrdlength:MAIn? (Query Only)\nReturns the record length of the main digital acquisition.\nGroup Horizontal\nSyntax HORizontal:DIGital:RECOrdlength:MAIn?\nHORizontal:DIGital:SAMPLERate:MAGnivu? (Query Only)\nReturns the sample rate of the MagniVu digital acquisition.\nGroup Horizontal\nSyntax HORizontal:DIGital:SAMPLERate:MAG"
