    "description": "在通过/失败掩码测试完成时向AUX:out端口发送TTL信号",
    "original_text": "MASK:TESt:AUXout:COMPLetion\nThis command will cause the instrument to send a TTL signal to the AUX:out\nport whenever a pass/fail mask test completes. The MASK:ACTONEVENT:ENABLE\ncommand should be set to ON for this event to happen. After the event occurs\nMASK:ACTONEVENT:ENABLE command will be set to OFF automatically.\nA series of examples showing how to use mask commands for typical tasks\nis included in an appendix. (See page E-1, Mask/Limit Command Sequence\nExamples.)\nGroup Mask\nSyntax MASK:TESt:AUXout:COMPLetion {ON|OFF|<NR1>}"
