    "original_text": "MASK:TESt:COMPLetion:CRITerion\nArguments <NR1> is an integer that specifies the number of tested waveform violations\noccurring in each mask test that will change the test status to ‘Failing’. The\nmaximum number of failed tested waveforms that can be specified is 1E09. The\ndefault is 1.\nExamples MASK:TESt:STOP:THReshold 50000 sets the instrument to change the test\nstatus to “failing” after 50,000 failed waveforms.\nMASK:TESt:STOP:THReshold? might return 50000 which indicates the\ninstrument has been set to change the test status to “failing” after 50,000 failed\nwaveforms."
