    "original_text": "MASK:USER:HTRIGPOS Specifies the nominal trigger position (pulse leading edge) to be used to draw a user-defined\ncustom mask, as a fraction of the display width.\nMASK:USER:LABel This command specifies a user-defined label for a custom mask.\nMASK:USER:RECOrdlength Specifies the nominal record length to be used for pulse mask testing with a user-defined\ncustom mask.\nMASK:USER{:SEG<x>|:MASK<x>} This command deletes the specified mask segment from the current mask segment. There\ncan be up to 8 segments.\nMASK:USER{:SEG<x>|:MASK<x>}:\nNR_Pt?\nThis query returns the number of points that make up the specified mask segment of a\nuser-defined custom mask. There can be up to 8 segments.\nMASK:USER{:SEG<x>|:MASK<x>}:\nPOINTS\nThis command specifies the x and y coordinates of the points that make up the segment\n1–8. The units are normal waveform units. The x-coordinate is specified relative to the\ntrigger. The points are specified as a sequence of (x,y) points which traverse the boundary\nof the segment in a counter-clockwise direction.\nMASK:USER:TRIGTOSAMP Specifies the nominal time, in seconds, from the (leading edge) trigger position to the pulse\nbit sampling position, to be used for testing with a user-defined custom mask.\nMASK:USER:VOFFSet Specifies the nominal value, in volts, to be used to vertically offset the input channels\nfor a user-defined custom mask.\nMASK:USER:VPOS Specifies the nominal value, in divisions, to be used to vertically position the input channels\nfor a user-defined cu"
