    "original_text": "MATH[1]:SPECTral:MAGnitude\nSets or queries the units for magnitude measurements in spectral analysis.\nGroup Math\nSyntax MATH[1]:SPECTral:MAGnitude {LINear|DB}\nMATH[1]:SPECTral:MAGnitude?\nArguments LINear specifies linear units for magnitude measurements.\nDB specifies decibel units for magnitude measurements."
