    "instruction": "MEASUrement:METHod",
    "description": "指定测量方法",
    "original_text": "MEASUrement:METHod This command specifies the method used for calculating reference levels\nMEASUrement:REFLevel? Returns the current reference level parameters\nMEASUrement:REFLevel:ABSolute:\nHIGH\nThis command specifies the top reference level for rise time\nMEASUrement:REFLevel:ABSolute:\nLOW\nThis command specifies the low reference level for rise time\nMEASUrement:REFLevel:ABSolute:\nMID<x>\nThis command specifies the mid reference level for the specified channel in absolute volts\nMEASUrement:REFLevel:METHod This command specifies the method for assigning high and low reference levels\nMEASUrement:REFLevel:PERCent:\nHIGH\nThis command specifies the top reference percent level for rise time\nMEASUrement:REFLevel:PERCent:\nLOW\nThis command specifies the low reference percent level for rise time\nMEASUrement:REFLevel:PERCent:\nMID<x>\nThis command specifies the mid reference level for the specified channel in percent\nMEASUrement:STATIstics Clears or returns all of the statistics accumulated for all period measurements (MEAS1\nthrough MEAS4)\nMEASUrement:STATIstics:MODe Turns measurement statistics on or off\nMEASUrement:STATIstics:\nWEIghting\nControls the responsiveness of the mean and standard deviation to waveform changes\nMiscellaneous Command Group\nUse the commands in the Miscellaneous Command Group to perform actions that\ndo not fit into other categories.\nTable 2-32: Miscellaneous Commands\nCommand Description\nAPPLication:LICENSE:SLOT<x>:\nLOCation?\nThis query returns the application license"
