    "description": "指定测量的绝对参考电平",
    "original_text": "MEASUrement:REFLevel:ABSOLute\nSets or queries absolute reference levels for measurements.\nGroup Measurement\nSyntax MEASUrement:REFLevel:ABSOLute <value>\nMEASUrement:REFLevel:ABSOLute?\nArguments <value> specifies the absolute reference level value."
