    "instruction": "MEASUrement:STATistics:WEIGHTing",
    "description": "指定统计测量的权重",
    "original_text": "MEASUrement:STATIstics:WEIghting\nThis command specifies the time constant for mean and standard deviation\nstatistical accumulations.\nGroup Measurement\nSyntax MEASUrement:STATIstics:WEIghting <NR1>\nMEASUrement:STATIstics:WEIghting?\nRelated Commands MEASUrement:STATIstics:MODe\nArguments <NR1> is the number of samples used for the mean and standard deviation\nstatistical accumulations.\nExamples MEASUREMENT:STATISTICS:WEIGHTING 4 sets statistical weighting to four\nsamples.\nMEASUREMENT:STATISTICS:WEIGHTING? might return\n:MEASUREMENT:STATISTICS:WEIGHTING 4 indicating that\nmeasurement statistics weighting is currently set to 4 samples."
