    "description": "指定当:FREQRef选择为FIXEDFREQuency时的频率值",
    "original_text": "POWer:HARMonics:FREQRef:FIXEDFREQValue\nThis command specifies the frequency value when the :FREQRef selection is\nFIXEDFREQuency.\nConditions This command requires option 3-PWR.\nGroup Power\nSyntax POWer:HARMonics:FREQRef:FIXEDFREQValue <NR3>"
