    "description": "返回固定频率值设置",
    "original_text": "POWer:HARMonics:FREQRef:FIXEDFREQValue?\nArguments <NR3> is a floating point number that specifies the fixed frequency value.\n2-434 3 Series MDO Oscilloscopes Programmer Manual\nCommands Listed in Alphabetical Order\nExamples POWER:HARMONICS:FREQREF:FIXEDFREQVALUE 100 sets the frequency to\n100 Hz.\nPOWER:HARMONICS:FREQREF:FIXEDFREQVALUE? might return\n:POWer:HARMonics:FREQREF:FIXEDFREQVALUE 60 indicating that the fixed\nfrequency value is set to 60 Hz."
