    "description": "返回IEC谐波基波电流设置",
    "original_text": "POWer:HARMonics:IEC:FUNDamental?\nArguments <NR3> is a floating point number that specifies the fundamental current in\namperes.\nExamples POWER:HARMONICS:IEC:FUNDAMENTAL 1 sets the fundamental current to\n1.0000 A.\nPOWER:HARMONICS:IEC:FUNDAMENTAL? might return\n:POWER:HARMONICS:IEC:FUNDAMENTAL 16 indicating that the\nfundamental current for IEC harmonics is set to 16.0000 A."
