    "original_text": "POWer:HARMonics:IEC:GROUPing\nThis command specifies the enabled state for grouping of IEC harmonics.\nConditions This command requires option 3-PWR.\n2-436 3 Series MDO Oscilloscopes Programmer Manual\nCommands Listed in Alphabetical Order\nGroup Power\nSyntax POWer:HARMonics:IEC:GROUPing {OFF|ON|1|0}"
