    "description": "指定IEC标准的线路频率",
    "original_text": "POWer:HARMonics:IEC:LINEFREQuency\nThis command specifies the line frequency for the IEC standard.\n3 Series MDO Oscilloscopes Programmer Manual 2-437\nCommands Listed in Alphabetical Order\nConditions This command requires option 3-PWR.\nGroup Power\nSyntax POWer:HARMonics:IEC:LINEFREQuency <NR1>"
