    "description": "返回IEC线路频率设置",
    "original_text": "POWer:HARMonics:IEC:LINEFREQuency?\nArguments <NR1> is an unsigned integer that specifies the line frequency. The valid values\nare 50 and 60.\nExamples POWER:HARMONICS:IEC:LINEFREQUENCY 50 sets the line frequency to 50 Hz.\nPOWER:HARMONICS:IEC:LINEFREQUENCY? might return\n:POWER:HARMONICS:IEC:LINEFREQUENCY 60 indicating that the\nline frequency value is set to 60 Hz."
