    "description": "指定IEC观察周期",
    "original_text": "POWer:HARMonics:IEC:OBSPERiod\nThis command specifies the IEC observation period.\nConditions This command requires option 3-PWR.\nGroup Power\nSyntax POWer:HARMonics:IEC:OBSPERiod <NR3>\nPOWer:HARMonics:IEC:OBSPERiod?\nArguments <NR3> is a floating point number that specifies the IEC observation period. Valid\nvalues ranges from 0.2 to 10 s.\nExamples POWER:HARMONICS:IEC:OBSPERIOD 3 sets the IEC observation period to\n3.0000 s.\nPOWER:HARMONICS:IEC:OBSPERIOD? might return\n:POWER:HARMONICS:IEC:OBSPERIOD 10 indicating that the IEC observation\nperiod is set to 10 s.\nPOWer:HARMonics:IEC:POWERFACtor\nThis command specifies the rated power factor for IEC harmonics."
