    "description": "指定MIL谐波基波电流的测量方法",
    "original_text": "POWer:HARMonics:MIL:FUNDamental:CALCmethod\nThis command specifies the measurement method for the MIL harmonics\nfundamental current for use in calculating limits.\nConditions This command requires option 3-PWR.\nGroup Power\nSyntax POWer:HARMonics:MIL:FUNDamental:CALCmethod {MEAS|USER}"
