    "original_text": "POWer:RIPPle:RESults:MAX? (Query Only)\nReturns the maximum of the peak-to-peak ripple measurements.\nConditions This command requires option 3-PWR.\nGroup Power\nSyntax POWer:RIPPle:RESults:MAX?\nExamples POWER:RIPPLE:RESULTS:MAX? might return :POWER:RIPPLE:RESULTS:MAX\n1.1 indicating that the maximum peak-to-peak amplitude is set to 1.1 V.\n3 Series MDO Oscilloscopes Programmer Manual 2-469\nCommands Listed in Alphabetical Order"
