    "description": "测量ACPR测量中第三个下侧通道与主通道之间的比率",
    "original_text": "RF:MEASUre:ACPR:LA3DB? (Query Only)\nThis query measures a ratio between the third lower side channel and the Main\nchannel when performing ACPR measurements using a frequency domain\ntrace. The power in the adjacent channel is equivalent to the power in the main\nchannel (dBm) added to the power ratio (dB) of the adjacent channel. (The RF\nmeasurement type must be set to ACPR using the command RF:MEASUre:TYPe.)\nConditions This command requires option 3-SA3.\nGroup RF\nSyntax RF:MEASUre:ACPR:LA3DB?\nRelated Commands RF:MEASUre:ACPR:ADJACENTPAIRs, RF:MEASUre:ACPR:CHANBW,\nRF:MEASUre:ACPR:CHANSPACing, RF:MEASUre:ACPR:POWer?,\nRF:MEASUre:ACPR:LA1DB?, RF:MEASUre:ACPR:LA2DB?,\nRF:MEASUre:ACPR:UA1DB?, RF:MEASUre:ACPR:UA2DB?,"
