    "original_text": "SEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:CAN{:IDentifier|:ADDRess}:MODe\nSpecifies the search mode for CAN bus identifier or address triggers.\nGroup Search\nSyntax SEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:CAN{:IDentifier|:ADDRess}:MODe {EQual|NOTEQual|LESSEqual|MOREEqual|INrange|OUTrange}\nSEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:CAN{:IDentifier|:ADDRess}:MODe?\nArguments EQual, NOTEQual, LESSEqual, MOREEqual, INrange, OUTrange specify different comparison modes for the search trigger."
