    "original_text": "POWer:RIPPle (No Query Form)\nThis command performs a vertical autoset for ripple measurements or sets the\nvertical offset to 0.\nConditions This command requires option 3-PWR.\n2-468 3 Series MDO Oscilloscopes Programmer Manual\nCommands Listed in Alphabetical Order\nGroup Power\nSyntax POWer:RIPPle {VERTAUTOset|VERTDEFault}\nArguments VERTAUTOset automatically scales the source waveform to optimize ripple\nmeasurements.\nVERTDEFault sets the vertical offset of the source waveform to 0 volts (for\nvoltage source) or 0 amperes (for current source)."
