    "instruction": "RECAll:MASK <QString>",
    "description": "从指定文件调用掩码",
    "original_text": "RECAll:MASK (No Query Form)\nThis command recalls the mask from a specified file that was saved to the current\nworking directory using the SAVe:MASK command.\nA series of examples showing how to use mask commands for typical tasks\nis included in an appendix. (See page E-1, Mask/Limit Command Sequence\nExamples.)\nConditions This command requires option 3-LMT.\nGroup Mask\n3 Series MDO Oscilloscopes Programmer Manual 2-501\nCommands Listed in Alphabetical Order\nSyntax RECAll:MASK <QString>\nRelated Commands SAVe:MASK\nArguments QString is a quoted string that is the name of the mask definition being recalled\nfrom the current working directory.\nExamples :RECall:MASK ”FOO.MSK” will recall a copy of the mask “FOO” from the\ncurrent working directory."
