    "original_text": "SEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:FLEXray:EOFTYPE\nThis command specifies which end of file type to use (static, dynamic or any)\nwhen searching on the FlexRay bus EOF field. The search condition needs to be\nset to EOF (using SEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:FLEXray:\nCONDition). SEARCH<x> is the search number, which is always 1, and B<x>\nConditions Requires 3-SRAUTO.\nGroup Search\nSyntax SEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:FLEXray:EOFTYPE\n{STATic|DYNAMic|ANY}\nSEARCH:SEARCH<x>:TRIGger:A:BUS:B<x>:FLEXray:EOFTYPE?\nArguments STATic sets the FlexRay end of frame type to STATIC.\nDYNAMic sets the FlexRay end of frame type to DYNAMIC.\nANY sets the FlexRay end of frame type to ANY"
