    "original_text": "TRIGger:A:BUS:SOUrce\nThis command specifies the source for a serial or parallel bus trigger, with the\nappropriate application module installed.\nConditions For I2C or SPI bus signals, install option 3-SREMBD.\nFor RS-232, RS-422, RS-485, or UART bus signals, install option\n3-SRCOMP.\nFor I2S, Left Justified (LJ), Right Justified (RJ), or TDM bus signals, install\noption 3-SRAUDIO.\nFor CAN, CAN FD, LIN, or FlexRay bus signals, install option 3-SRAUTO.\nFor MIL-STD-1553 bus signals, install option 3-SRAERO.\nFor USB bus signals, install option 3-SRUSB2. Note that 1 GHz bandwidth\nmodels are recommended for high-speed (HS) USB.\nA table is available listing the commands enabled by each application module.\n(See page H-1, List of Beta Commands and Features.)\nGroup Trigger\nSyntax TRIGger:A:BUS:SOUrce {B1|B2|B3|B4}"
