    "original_text": "TRIGger:A:MODe This command specifies the A trigger mode – either AUTO or NORMAL.\nTRIGger:A:PULse:CLAss This command specifies which kind of pulse to trigger on (either runt, width,\ntransition (rise/fall or slew rate) or timeout). You also need to set the trigger\ntype to PULSe using the command TRIGger:A:TYPe.\nTRIGger:A:PULSEWidth:HIGHLimit This command specifies the upper limit to use, in seconds, when triggering\non detection of a pulse whose duration is inside or outside a range of two\nvalues. (Use TRIGger:A:PULSEWidth:LOWLimit to specify the lower value\nof the range.)\nTRIGger:A:PULSEWidth:LOWLimit This command specifies the lower limit to use, in seconds, when triggering\non detection of a pulse whose duration is inside or outside a range of two\nvalues. (Use TRIGger:A:PULSEWidth:HIGHLimit to specify the upper limit\nof the range.)\nTRIGger:A:PULSEWidth:POLarity This command specifies the polarity for the A pulse width trigger\nTRIGger:A:PULSEWidth:SOUrce This command specifies the source for the pulse width trigger\nTRIGger:A:PULSEWidth:WHEn This command specifies to trigger when a pulse is detected with a\nwidth (duration) that is less than, greater than, equal to, or unequal to a\nspecified value (set using TRIGger:A:PULSEWidth:WIDth), OR whose\nwidth falls outside of or within a specified range of two values (set using"
