    "description": "指定建立和保持触发器的时钟电压阈值",
    "original_text": "TRIGger:A:SETHold:CLOCk:THReshold This command specifies the clock voltage threshold for setup and hold trigger\nTRIGger:A:SETHold:DATa? Returns the voltage threshold and data source for the setup/hold trigger\nTRIGger:A:SETHold:DATa:SOUrce This command specifies the data source for the setup and hold trigger\nTRIGger:A:SETHold:DATa:THReshold This command specifies the data voltage threshold for setup and hold trigger\nTRIGger:A:SETHold:HOLDTime This command specifies the hold time for the setup and hold violation triggering\nTRIGger:A:SETHold:SETTime This command specifies the setup time for setup and hold violation triggering\nTRIGger:A:SETHold:THReshold:CH<x> Sets or queries the threshold for the channel\nTRIGger:A:SETHold:THReshold:D<x> Sets the A trigger setup and hold threshold for the selected digital channel\nTRIGger:A:TIMEOut:POLarity When triggering using the TIMEOut trigger type, this commands specifies\nthe polarity to be used.\nTRIGger:A:TIMEOut:SOUrce When triggering using the TIMEOut trigger type, this command specifies the\nsource. The available sources are live channels, external (or auxillary) input,\nand digital channels. The default is channel 1.\nTRIGger:A:TIMEOut:TIMe When triggering using the TIMEOut trigger type, this command specifies the\ntimeout time, in seconds. The default and minimum is 4.0E-9 seconds and the\nmaximum is 8.0 seconds. The resolution is 800.0E-12 which means that the\nincrements of time specified is 800 picoseconds.\nTRIGger:A:TYPe This command sets the type of A trigger (edge, logic, pulse, bus or video). If\nyou set the trigger type to LOGIc, you also need to set the logic trigger class\n(logic or setup/hold) using the command TRIGger:A:LOGIc:CLAss. If you set\nthe trigger type to PULSe, you also need to set the pulse trigger class (runt,\nwidth, transition or timeout), using the command TRIGger:A:PULse:CLAss.\nTRIGger:A{:TRANsition|:RISEFall}? Returns the delta time, polarity, and both upper and lower threshold limits\nfor the transition time trigger\nTRIGger:A{:TRANsition|:RISEFall}:DELTatime This command specifies the delta time used in calculating the transition value\nTRIGger:A{:TRANsition|:RISEFall}:POLarity This command specifies the polarity for the A pulse transition trigger\nTRIGger:A{:TRANsition|:RISEFall}:SOUrce This command specifies the source for transition trigger.\nTRIGger:A{:TRANsition|:RISEFall}:WHEn This command specifies the relationship of delta time to transitioning signal\nTRIGger:A:TYPe This command specifies the type of A trigger. Once you have set the trigger\ntype, you may also need to identify the associated trigger class. For details on\nselecting Logic and Pulse trigger classes, see TRIGger:A:LOGIc:CLAss and"
