    "original_text": "WFMOutpre:REFLEvel? (Query Only)\nThis query returns the Reference Level of the outgoing waveform. It applies only\nto the four frequency domain waveforms (RF Normal, RF Average, RF Max Hold,\nand RF Min Hold). The units are in watts.\nConditions Requires option 3-SA3.\nGroup Waveform Transfer\nSyntax WFMOutpre:REFLEvel?\nExamples WFMOutpre:REFLevel? might return 1.0000E-3, indicating a Reference Level\nof 1 mW."
