    "original_text": "WFMOutpre:SPAN? (Query Only)\nThis query returns the frequency span of the outgoing waveform. For non-MDO\nmodels, this query always returns 0.0.\nThe span is the range of frequencies you can observe around the center frequency.\nConditions Requires option 3-SA3.\n3 Series MDO Oscilloscopes Programmer Manual 2-857\nCommands Listed in Alphabetical Order\nGroup Waveform Transfer\nSyntax WFMOutpre:SPAN?\nExamples RF:SPAN? might return 10.0000E+6, indicating the span is 10MHz."
