    "original_text": "WFMOutpre:WFMTYPe? (Query Only)\nThis query returns the type of the outgoing waveform. RF_FD indicates an RF\nfrequency domain waveform; ANALOG indicates Channel 1–4 or the Math\nwaveform. The default is analog.\nThe type of waveform that is being transferred in turn determines which window\nwill display it on the instrument screen: (the time domain window or frequency\ndomain window). Analog arguments specify the time domain window; the\nRF_RD argument specifies the frequency domain window.\nConditions This command requires option 3-SA3.\nGroup Waveform Transfer"
